Đồ thị của $y = f(x)$ được hiển thị bên dưới.

[asy]
đơn vị(0,5 cm);

func thực (x thực) {
  thực y;
  nếu (x >= -3 && x <= 0) {y = -2 - x;}
  if (x >= 0 && x <= 2) {y = sqrt(4 - (x - 2)^2) - 2;}
  if (x >= 2 && x <= 3) {y = 2*(x - 2);}
  trở lại (y);
}

int tôi, n;

vì (i = -5; i <= 5; ++i) {
  draw((i,-5)--(i,5), grey(0.7));
